import React from 'react';
import cover from '../assets/cookbook-coverpage.png';
import '../styles.css';

const CoverPage = () => {
    return (
        <div className='cover-page'>
            <img src={cover} alt="M and J Recipe Book cover" />
            <button className='next-page-button'>Next Page</button>
        </div>
    );
};

export default CoverPage;
